import React from 'react';
import IntroTextContainer from './container';
import viewQuestions from './viewQuestions'

export class IntroTextLayout extends React.Component {
    render() {
      let intro = true;  

      if(intro) {
        return (
          <IntroTextContainer intro={intro}/>
        );
      } else {
        return (
          <viewQuestions />
        );
      }
    }
}
